import {
  Button,
  Card,
  CardContent,
  CardMedia,
  Collapse,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";
import { Grid } from "@mui/material";
import { ExpandMore } from "@material-ui/icons";
import { useState, useEffect } from "react";
import file1 from '../../others/file1.png'

export const Items = ({ id, name, description, tag, quantity, blockchain }) => {
  const [expanded, setExpanded] = useState(false);

  const images = [
    {
      'id': 1,
      'src': '../../others/file1.png'
    },
    {
      'id': 2,
      'src': '../../others/file2.png'
    },
    {
      'id': 3,
      'src': '../../others/file3.png'
    },
    {
      'id': 4,
      'src': '../../others/file4.png'
    },
  ];
  useEffect(()=> {
    let img = images.map(e => e)
    console.log(img)
  }, [])


  return (
    <Grid xs display="flex" justifyContent="center" alignItems="center">
      <Box
        sx={{
          display: "flex",
          flexWrap: "wrap",
          p: 1,
          m: 1,
          bgcolor: "background.paper",
          maxWidth: 600,
          borderRadius: 1,
        }}
      >
        <Card style={{ maxWidth: 200 }}>
          <CardContent>
            <Typography variant="h5">{name}</Typography>
          </CardContent>
          <CardMedia image={file1} component="img"/>
          <ExpandMore onClick={() => setExpanded(!expanded)} />
          <Collapse in={expanded}>
            <CardContent>
              <Typography variant="h6">description:{description}</Typography>
              <Typography variant="h6">tag:{tag}</Typography>
              <Typography variant="h6">quantity:{quantity}</Typography>
              <Typography variant="h6">blockchain:{blockchain}</Typography>
              <Button
                variant="contained"
                //href={card.credit}
                target="_blank"
              >
                Add to card
              </Button>
            </CardContent>
          </Collapse>
        </Card>
      </Box>
    </Grid>
  );
};
